  input: "\"TEXT\",\"F3XA\",\"C00409003\",\"November 17, 2006    Rosa G Lewis  Reports
    Analysis Division  Federal Election Commission  999 E 9th Street\t  Washington,
    DC  20463    Dear Rosa,    This letter is in response to your November 1, 2006,
    letter of inquiry regarding the October Quarterly Report (7/1/06 - 9/30/06) for
    Heartland Values PAC (C00409003).  We have reviewed our records supporting the
    above-referenced report and provide the following additional information in response
    to your questions:    Schedule B discloses one or more contributions which appear
    to exceed the limits:  Heartland Values PAC made two contributions to Bouchard
    for US Senate.  Due to clerical error, both of these $5000 contributions were
    reported in the 2006 Primary.  Our report has now been changed to reflect the
    contributions correctly; $5000 to the 2006 Primary Election Cycle and $5000 to
    the 2006 General Election Cycle.  I have attached our amended report.    Schedule
    A supporting Line 15 discloses a payment from a federal candidate committee for
    goods and/or services provided by your committee:  Thank you for flagging this
    issue.  Please be assured that yes, it was the usual and normal charge for the
    goods and/or services provided.        Schedule A supporting Line 15 payment from
    a federal candidate committee for goods and/or services provided:  A purpose of
    Reimb by FOJT See Pg 29 was added to each disbursement that was included in this
    offset to an operating expenditure totaling $3,607.31 from Friends of John Thune.
    \   For future reporting only contributions to federal candidates and political
    committees should be itemized on a separate Schedule B supporting Line 23:  Changes
    were made so the contributions to non-federal candidates and committees are itemized
    on Schedule B supporting Line 29 rather than Schedule B supporting Line 23.    We
    trust this information answers your questions.  If you have any further questions
    or need additional information, please do not hesitate to contact me at 605/376-3437.
    \   Sincerely,    Barb Buell  Deputy Treasurer  Heartland Values PAC  PO Box 505
    \ Sioux Falls, SD  57101-0505\""
